import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import Card from './Card';
import Sdata from './Sdata';
console.log(Sdata[0]);
// import Project1 from './Project1'
// import Project2 from './Project2'
// root
function ncard(val){
    return(
<Card imgsrc={val.imgsrc} text={val.text} title={val.title} link={val.link}/>
    );
}

ReactDOM.render(<>
<h1>List Off 5 Netflix Series</h1>

<Card imgsrc={Sdata[0].imgsrc} text={Sdata[0].text} title={Sdata[0].title} link={Sdata[0].link}/>
<Card imgsrc={Sdata[1].imgsrc} text={Sdata[1].text} title={Sdata[1].title} link={Sdata[1].link}/>
<Card imgsrc={Sdata[2].imgsrc} text={Sdata[2].text} title={Sdata[2].title} link={Sdata[2].link}/>

</>
,document.getElementById('root'));

